:root,
::backdrop {

--sans-font: -apple-system, BlinkMacSystemFont, "Avenir Next", Avenir,

"Helvetica Neue", sans-serif;
--mono-font: Consolas, Menlo, Monaco, "Andale Mono", "Ubuntu Mono", monospace;
--standard-border-radius: 5px;

--bg: #fff;
--accent-bg: #f5f7ff;
--text: #212121;
--text-light: #585858;
--border: #898EA4;
--accent: #0d47a1;
--code: #d81b60;
--preformatted: #444;
--marked: #ffdd33;
--disabled: #efefef;
}

@media (prefers-color-scheme: dark) {

::backdrop {
color-scheme: dark;
--bg: #212121;
--accent-bg: #2b2b2b;
--text: #dcdcdc;
--text-light: #ababab;
--accent: #ffb300;
--code: #f06292;
--preformatted: #ccc;
--disabled: #111;
}

img,
video {
opacity: 0.8;
}
}

*, *::before, *::after {
box-sizing: border-box;
}

textarea,
select,
input,
progress {
appearance: none;
-webkit-appearance: none;
-moz-appearance: none;
}
html {

font-family: var(--sans-font);

}

body {
color: var(--text);

font-size: 1.15rem;

display: grid;
grid-template-columns: 1fr min(45rem, 90%) 1fr;
margin: 0;
}
body > * {
grid-column: 2;
}

body > header {
background-color: var(--accent-bg);
border-bottom: 1px solid var(--border);

}
body > header h1 {
max-width: 1200px;
margin: 1rem auto;
}
body > header p {
max-width: 40rem;
margin: 1rem auto;
}

main {
padding-top: 1.5rem;
}
body > footer {
margin-top: 4rem;
padding: 2rem 1rem 1.5rem 1rem;

text-align: center;

}

h1 {
font-size: 3rem;
}
h2 {
font-size: 2.6rem;

}

}
h5 {
font-size: 1.15rem;
}

}

p, h1, h2, h3, h4, h5, h6 {
overflow-wrap: break-word;
}

h1,
h2,
h3 {
line-height: 1.1;
}

@media only screen and (max-width: 720px) {
h1 {
font-size: 2.5rem;
}
h2 {
font-size: 2.1rem;
}
h3 {
font-size: 1.75rem;
}
h4 {
font-size: 1.25rem;
}
}

a,
a:visited {
color: var(--accent);
}
a:hover {
text-decoration: none;
}
button,
.button,
a.button, 
input[type="submit"],
input[type="reset"],
input[type="button"],
label[type="button"] {
border: none;
border-radius: var(--standard-border-radius);
background-color: var(--accent);
font-size: 1rem;
color: var(--bg);
padding: 0.7rem 0.9rem;
margin: 0.5rem 0;
text-decoration: none;
font-family: inherit;
line-height: normal;
}
.button[aria-disabled="true"], input:disabled,
textarea:disabled,
select:disabled,
button[disabled] {
cursor: not-allowed;
background-color: var(--disabled);
color: var(--text-light)
}
input[type="range"] {
padding: 0;
}

abbr[title] {
cursor: help;
text-decoration-line: underline;
text-decoration-style: dotted;
}
button:enabled:hover,
.button:not([aria-disabled="true"]):hover,
input[type="submit"]:enabled:hover,
input[type="reset"]:enabled:hover,
input[type="button"]:enabled:hover,
label[type="button"]:hover {
filter: brightness(1.4);
cursor: pointer;
}
.button:focus-visible,
button:focus-visible:where(:enabled),
input:enabled:focus-visible:where(
[type="submit"],
[type="reset"],
[type="button"]
) {
outline: 2px solid var(--accent);

}

header > nav {
font-size: 1rem;

header > nav ul,

align-content: space-around;

flex-wrap: wrap;
justify-content: center;
list-style-type: none;
margin: 0;
padding: 0;

header > nav ul li,
header > nav ol li {
display: inline-block;

header > nav a:visited {
margin: 0 0.5rem 1rem 0.5rem;

border-radius: var(--standard-border-radius);
color: var(--text);
display: inline-block;
padding: 0.1rem 1rem;
text-decoration: none;
}
header > nav a:hover,
header > nav a.current,
header > nav a[aria-current="page"] {
border-color: var(--accent);
color: var(--accent);
cursor: pointer;
}

@media only screen and (max-width: 720px) {
header > nav a {
border: none;
padding: 0;
text-decoration: underline;
line-height: 1;
}
}

background-color: var(--accent-bg);
border: 1px solid var(--border);
border-radius: var(--standard-border-radius);

}
aside {
font-size: 1rem;
width: 30%;
padding: 0 15px;
margin-inline-start: 15px;
float: right;
}

@media only screen and (max-width: 720px) {

}

}
article h2:first-child,
section h2:first-child {

}
section {

section + section,
section:first-child {

section:last-child {
border-bottom: 0;

padding: 0.7rem 1rem;

margin-bottom: 0.5rem;

margin-bottom: 0;

td,
th {

textarea,
select,
input {

padding: 0.5rem;

label {

textarea:not([cols]) {

select:not([multiple]) {

}

}

input[type="checkbox"],
input[type="radio"] {

position: relative;
width: min-content;
}
input[type="checkbox"] + label,
input[type="radio"] + label {
display: inline-block;
}
input[type="radio"] {
border-radius: 100%;
}
input[type="checkbox"]:checked,
input[type="radio"]:checked {
background-color: var(--accent);
}
input[type="checkbox"]:checked::after {

content: " ";
width: 0.18em;
height: 0.32em;
border-radius: 0;
position: absolute;
top: 0.05em;
left: 0.17em;
background-color: transparent;
border-right: solid var(--bg) 0.08em;
border-bottom: solid var(--bg) 0.08em;
font-size: 1.8em;
transform: rotate(45deg);
}
input[type="radio"]:checked::after {

content: " ";
width: 0.25em;
height: 0.25em;
border-radius: 100%;
position: absolute;
top: 0.125em;
background-color: var(--bg);
left: 0.125em;
font-size: 32px;
}

}
